    int n = 200;

    auto [r,c] = Find(24);
    if (r < 0 && c < 0) {
        r = abs(r);
        c = abs(c);
    }
    else if (r < 0 && c > 0) {
        r = abs(r);
        c = abs(c-199);
    }
    else if (r > 0 && c < 0) {
        r = abs(r-199);
        c = abs(c);
    }
    else if (r > 0 && c > 0) {
        r = abs(r-199);
        c = abs(c-199);
    }

    int r1 = r, r2 = r + n;
    int c1 = c + 2*n, c2 = c + 3*n;

    pii pos_r1, pos_r2, pos_c1, pos_c2;
    for (int i=-1; i<=1; i++) {
        for (int j=-1; j<=1; j++) {
            int nr = r + i;
            int nc = c + j;
            if (b[nr][nc] == r1 || b[nr][nc] == r1-1) {
                pos_r1 = {nr,nc};
            }
            if (b[nr][nc] == r2 || b[nr][nc] == r2-1) {
                pos_r2 = {nr,nc};
            }
            if (b[nr][nc] == c1 || b[nr][nc] == c1-1) {
                pos_c1 = {nr,nc};
            }
            if (b[nr][nc] == c2 || b[nr][nc] == c2-1) {
                pos_c2 = {nr,nc};
            }
        }
    }
    auto res_r1 = Get(pos_r1.first-r,pos_r1.second-c);
    auto res_r2 = Get(pos_r2.first-r,pos_r2.second-c);
    auto res_c1 = Get(pos_c1.first-r,pos_c1.second-c);
    auto res_c2 = Get(pos_c2.first-r,pos_c2.second-c);

    auto convert = [&] (int q, int r) {
        int ret = 23*(q-1) + r-1;
        return ret;
    };

    auto mask1 = convert(res_r1, res_r2);
    auto mask2 = convert(res_c1, res_c2);
    int sz = 9;
    vi ans(sz);
    for (int i=0; i<sz; i++) {
        bool b1 = (mask1>>i&1);
        bool b2 = (mask2>>i&1);
        if (b1 && b2) ans[i] = 1;
        else if (b1) ans[i] = 4;
        else if (b2) ans[i] = 2;
        else ans[i] = 3;
    }
    return ans;
